import React from "react";
import { Card, TextContainer, TextStyle } from '@shopify/polaris';

const Footer = () => {
    return (
        <Card.Section>
            <TextContainer>
                <TextStyle variation="subdued">Have any feedback? Let us know your thoughts here.</TextStyle>
            </TextContainer>
        </Card.Section>
    )
}

export default Footer
